var image = document.createElement('img');
image.alt = "image to crop";
image.src = "data:image/jpg;base64,"
document.getElementById("image-container").appendChild(image);

var x = 200;
var y = 200;
var cropWidth = 600;
var cropHeight = 500;

var myCropper = new Cropper(image, {
  viewMode: 1,
  initialAspectRatio: 1/1,
  autoCrop: true,
  ready: null,
  cropstart: null,
  cropmove: null,
  cropend: null,
  crop: null,
  zoom: null,
  dragMode: 'crop',
  modal: true,
  guides: false,
  autoCropArea: 0.8,
  aspectRatio: null,
  highlight: false,
  background: false,
  movable: true,
  rotatable: false,
  scalable: false,
  zoomable: true,
  zoomOnTouch: true,
  zoomOnWheel: false,
  wheelZoomRatio: 0.1,
  cropBoxMovable: true,
  cropBoxResizable: true,
  toggleDragModeOnDblclick: true,
  ready: null,
  cropstart: null,
  cropmove: null,
  cropend: null,
  crop: null,
  zoom: null,
});

var options = {
  width: cropWidth,
  height: cropHeight,
  minWidth: cropWidth,
  minHeight: cropHeight,
  maxWidth: 50000,
  maxHeight: 50000,
  fillColor: "transparent",
  imageSmoothingEnabled: true,
  imageSmoothingQuality: "high"
}

$(document).ready(function(){
  getCroppedCanvas();
})

function getCroppedCanvas() {
  console.log(myCropper.getContainerData())
  var data = {"x":x,"y":y,"width":cropWidth,"height":cropHeight,"rotate":0,"scaleX":1,"scaleY":1};
  myCropper.setData(data);
  var canvasContainer = document.getElementById("canvas-container");
  var canvas = myCropper.getCroppedCanvas(options);
  canvas.setAttribute("id","my-canvas");
  canvasContainer.appendChild(canvas);
  var link = document.createElement("a");
  link.download = 'cropped-image.png';
  link.href = document.getElementById('my-canvas').toDataURL();
  link.click()
}

